import React from 'react'
import Container from '@material-ui/core/Container'
import Button from '@material-ui/core/Button'
import Particles from 'react-particles-js'
import Grid from '@material-ui/core/Grid'
import Avatar from '@material-ui/core/Avatar'

const particleOpt = {
  particles: {
    number: {
      value: 100,
      density: {
        enable: false,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    return (
      <React.Fragment>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Container className="wrapper" xs>
          <Grid xs={2} item></Grid>
          <Grid className="introduction" item xs={8}>
            <Grid container xs>
              <Grid item direction="column" xs={3}>
                <Avatar alt="Profile Picture" size="large" src="/img/maicon.png" />
              </Grid>
              <Grid item xs={9} className="hello" direction="column" component="hgroup">
                <h1 align="center">Hello, I'm <span>Maicon Esteves</span></h1>
                <h2 align="center">I'm a full-stack developer</h2>
              </Grid>
              <Button className="bt-index" variant="outlined" size="large" color="secondary" href="home">Default</Button>
            </Grid>
          </Grid>
          <Grid item xs={2}></Grid>
        </Container>
      </React.Fragment>
    )
}

export default Index
